import { NavBar, About, Footer } from "./Components";

import './index.css'
import Login from './pages/LoginPage/Login';
import { BrowserRouter as Router, Route ,Switch} from 'react-router-dom';


const App = () => {
  return( 
     <div>
    <div>
         <NavBar/>
    </div>
    <div>
    <About />
    <Footer/>
  </div>
  <Router>
        <div>
                <Switch>
                <Route path='/login' element={<Login/>}/>
                </Switch>
        </div>
        </Router>
</div>

);

}

export default App
